listing_description:
Located in the heart of the CBD, this is the only residential development in Melbourne with a direct underground connection to the Melbourne Central Train Station and the city's retail shopping centre. Enjoy the convenience and connectivity to everything, including world-leading universities such as the University of Melbourne and RMIT, cultural attractions, superb shopping, entertainment and dining only an elevator ride away.

This apartment comprise of:
- One bedrooms with BIR, one bathroom
- Modern kitchen with gas cooks top and dishwasher;
- Open plan dining/living area with a terrace;
- Light filled floor-to-ceiling windows throughout;

A self-contained community, catering to your every need, including Private Cinema, Karaoke Room, Gymnasium, Themed Dining and Lounge Rooms, Sauna, Steam, 25m Indoor Lap Pool, Reading Lounge, Plunge Pool / Outdoor Jacuzzi, Outdoor Dining and BBQ area, Sundeck, Yoga Zone, Dance Barre, High Tea Room, and more (Access may be restricted due to COVID-19).
